import React, { Component } from "react";

import Navigation from '../Navigation';
import HamburgerMenu from '../HamburgerMenu';

class Menu extends Component {
  state = {
    isMenuOpen: false,
  };

  render() {
    return (
      <>
        <Navigation />
        <HamburgerMenu />
      </>
    );
  }
}

export default Menu;
